INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('48', ' Welcome \r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\n Thank you for visiting Cornerstone\'s website. &nbsp;We look forward to getting to know you as you get to know us. &nbsp;You can find out more about Cornerstone, who we are, and what we are passionate about by browsing the links to the left, visiting our&nbsp;About&nbsp;page, and watching our Gospel Vision video below. \r\n &nbsp; \r\n    ', 'I\'m New Here', '', '/i-m-new-here', '2010-03-03 19:14:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('49', ' Overview \r\n   \r\nCornerstone is a Gospel-Centered Independent Bible Church. Our emphases are breathing the Gospel moment by moment and living the Gospel in word and deed; expository preaching; text-driven theology; mercy-laden outreach; sanctification in community; and Gospel-driven, multi-generational worship. \r\n  \r\nAre you looking for a church? The links on the left will direct you to detailed information about Cornerstone\'s doctrine and practice. \r\n &nbsp;  ', 'About', '', '/about', '2010-03-03 19:26:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('50', '', 'Get Involved', '', '', '2010-03-03 19:26:00');
