INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('56', 'Who He Is\r\n &nbsp; \r\nWhat He\'s Done\r\n &nbsp; \r\nHow We Must Respond\r\n &nbsp;  ', 'Jesus Christ', '', '/i-m-new-here/jesus-christ', '2010-03-18 00:31:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('57', 'The Gospel literally means &ldquo;good news.&rdquo;&nbsp; In the Bible, the gospel is the good news regarding what God accomplished in the person and work of Jesus Christ - namely our salvation. &nbsp;The entire Bible tells the story of the lengths that God went to in order to bring glory to Himself and save sinners. &nbsp;Scripture prepares us for the gospel, recalls the events of the gospel, and celebrates the triumphs of the gospel throughout its pages. &nbsp; \r\nThe gospel proclaims the beautiful truth that \" \r\nCornerstone is all about the gospel.  Not only for salvation but for living every single moment.  ', 'The Gospel', '', '/i-m-new-here/the-gospel', '2010-03-18 00:32:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('58', 'We encourage you to visit us for either of our Sunday Celebration Services. &nbsp;Our first service is from 8:30-10:00 a.m. and our second service is from 10:30-12:00 p.m. For directions see our Location &amp; Services. &nbsp; \r\nParking\r\nUpon your arrival, you are welcome to park in either our lower or upper parking lots. &nbsp; \r\nChildren\r\nChildren are welcome to participate in our entire service. &nbsp;Those who stay during our preaching time will receive \"kid\'s sermon notes\" and are encouraged to follow along as we study the Word. &nbsp;We also provide a full-range of Children\'s Ministry options including: \r\n\r\nNursery &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (0-2 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services\r\nToddler Care &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2-3 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services\r\nChildren\'s Church &nbsp; &nbsp; (4-9 years) &nbsp; &nbsp; &nbsp; &nbsp; 9:00-10:00 a.m.\r\nWorship Time &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 10:30-11:00 a.m.\r\nSunday School &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 11:00-1200 p.m.\r\n\r\nTo learn more about Children\'s Ministry check out our Ministries&nbsp;page. \r\nAdult\r\nAdults are encouraged to join us for our equipping school. &nbsp;We have classes offered during both services. &nbsp;To find out more about current classes being offered check out our&nbsp;Ministries&nbsp;page. \r\n&nbsp; \r\n&nbsp; \r\n   ', 'What to Expect', '', '/i-m-new-here/what-to-expect', '2010-03-18 00:32:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('59', 'We want to invite you to join us for our next visitor\'s reception. &nbsp;This is a time for recent visitors to connect with some of the pastoral staff and learn more about Cornerstone. &nbsp;We usually meet right after our second service for a time of meet and greet, Q &amp; A, and refreshments. \r\nOur next Visitor\'s Reception is:\r\nApril 25, 2010 from&nbsp;12:15-1:15 p.m.\r\nRegister for the Reception to let us know you\'re coming: ', 'Visitor\'s Reception', '', '/i-m-new-here/visitor-s-reception', '2010-03-18 00:32:00');
