INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('61', 'Sunday Service Times are:\r\n 8:30 am &amp; 10:30 am \r\nWe are located at:\r\n 1363 W. Linden St. Riverside, CA 92507  ', 'Location & Services', '', '/i-m-new-here/location-and-services', '2010-03-18 00:33:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('62', 'Cornerstone is a Gospel-Centered Independent Bible Church. Our emphases are breathing the Gospel moment by moment and living the Gospel in word and deed; expository preaching; text-driven theology; mercy-laden outreach; sanctification in&nbsp;community; and Gospel-driven, multi-generational worship. \r\n\r\nAre you looking for a church? The links on the left will direct you to detailed information about Cornerstone\'s doctrine and practice. \r\n  ', 'Overview', '', '/about/overview', '2010-03-18 00:35:00');
