INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('65', 'We exist to glorify God by:\r\n\r\nExperiencing the gospel in all of its fullness\r\nExalting the Lord through worship\r\nEdifying the saints through mutual ministry\r\nEvangelizing the world through outreach\r\n\r\nOur mission statement guides all that Cornerstone does and is passionate about. &nbsp;The Bible gives us our ultimate mission - to glorify God. &nbsp;Romans 11:36 says \"For from Him and through Him and to Him are all things. To Him be the glory forever. Amen.\" \r\nExperiencing the Gospel in all of its Fullness\r\nCornerstone seeks to glorify God by individually and corporately experiencing the power and wonder of the gospel in our own lives and together with one another. &nbsp;We do this by daily rehearsing and living inside of the gospel. &nbsp;As we are consumed by the gospel and moved by its power, we find ourselves growing in our love for God and living for His glory. \r\nExalting the Lord through Worship\r\nCornerstone seeks to glorify God by individually and corporately exalting the Lord through worship. &nbsp;We do this as individuals by living a life that is consumed with making much of Jesus. &nbsp;Exalting the Lord continues in our homes as families daily gather to praise and magnify God together in family worship. &nbsp;Finally, each Sunday, Cornerstone corporately gathers to exalt the Lord through worship in song and the study of His Word. &nbsp; \r\nEdifying the Saints through Mutual Ministry\r\nCornerstone seeks to glorify God by equipping each believer to serve Him with their entire lives. &nbsp;This includes providing opportunities for edification, instruction, accountability, and service. &nbsp;We do this through among other things our Sunday service, Care Group ministry, and weekday Bible studies. &nbsp; \r\nEvangelizing the World through Outreach\r\nCornerstone seeks to glorify God by evangelizing the world through outreach. &nbsp;Our desire is to proclaim the power of the gospel through our words and lives to those who know Jesus Christ and those who do not. &nbsp;We do this as individuals, families, Care Groups, and missionaries. &nbsp;Our goal is to take the gospel across the street and around the world. \r\n&nbsp; \r\n&nbsp; \r\n&nbsp; \r\n\r\n ', 'Our Mission', '', '/about/our-mission', '2010-03-18 00:36:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('66', ' &nbsp; \r\nA. The Holy Scriptures\r\n We believe the Holy Scriptures of the Old and New Testaments to be the verbally-inspired Word of God, the final authority for faith and life, inerrant in the original writings, infallible and God-breathed (II Tim. 3:16-17; II Peter 1:20-21; Matt. 5:18; John 16:12-13). \r\n  \r\nB. The Godhead\r\n We believe in one Triune God, eternally existing in three Persons - Father, Son, and Holy Spirit - co-eternal in being, co-identical in nature, co-equal in power and glory, and having the same attributes and perfections (Deut. 6:4; II Cor. 13:14). \r\n  \r\nC. The Person and Work of Christ\r\n 1. We believe that the Lord Jesus Christ, the eternal Son of God, became man, without ceasing to be God, having been conceived by the Holy Spirit and born of the Virgin Mary, in order that He might reveal God and redeem sinful men (John 1:1,2,14; Luke 1:35). \r\n 2. We believe that the Lord Jesus Christ accomplished our redemption through His death on the cross as a representative, vicarious, substitutionary sacrifice; and, that our justification is made sure by His literal physical resurrection from the dead (Rom. 3:24-25; I Peter 2:24; Eph. 1:7; I Peter 1:3-5). \r\n 3. We believe that the Lord Jesus Christ ascended to heaven and is now exalted at the right hand of God, where, as our High Priest, He fulfills the ministry of Representative, Intercessor, and Advocate (Acts 1:9-10; Heb. 9:24; 7:25; Rom. 8:34; I John 2:1-2). \r\n  \r\nD. The Person and Work of the Holy Spirit\r\n 1. We believe that the Holy Spirit is a person who convicts the world of sin, of righteousness, and of judgement; and, that He is the supernatural Agent in regeneration, baptizing all believers into the Body of Christ, indwelling and sealing them unto the day of redemption (John 16:8-11; II Cor. 3:6; I Cor. 12:12-14; Rom. 8:9; Eph. 1:13-14). \r\n 2. We believe that He is the Divine Teacher who guides believers into all truth; and, that it is the privilege and duty of all the saved to be filled with the Spirit (John 16:13; I John 2:20, 27; Eph. 5:18). \r\n  \r\nE. The Total Depravity of Man\r\n We believe that man was created in the image and likeness of God, but in Adam\'s sin the race fell, inherited a sinful nature, and became alienated from God; and, that man is totally depraved, and, of himself, utterly unable to remedy his lost condition (Gen. 1:26-27; Rom 3:22-23; 5:12; Eph. 2:1-3,12). \r\n  \r\nF. Salvation\r\n We believe that salvation is the gift of God brought to man by grace and received by personal faith in the Lord Jesus Christ, whose precious blood was shed on Calvary for the forgiveness of our sins (Eph. 2:8-10; John 1:12; Eph. 1:7; I Peter 1:18-19). \r\n  \r\nG. The Eternal Security and Assurance of Believers\r\n 1. We believe that all the redeemed, once saved, are kept by God\'s power and are thus secure in Christ forever (John 6:37-40; 10:27-30; Rom. 8:1,38-39; I Cor. 1:4-8; I Peter 1:5). \r\n 2. We believe that it is the privilege of believers to rejoice in the assurance of salvation through the testimony of God\'s Word; which, however, clearly forbids the use of Christian liberty as an occasion to the flesh (Rom 13:13-14; Gal. 5:13; Titus 2:11-15). \r\n  \r\nH. The Two Natures of the Believer\r\n We believe that every saved person posseses two natures, with provision made for victory of the new nature over the old nature through the power of the indwelling Holy Spirit; and, that all claims to the eradication of the old nature in this life are unscriptural (Rom. 6:13; 8:12-13; Gal. 5:16-25; Eph. 4:22-24; Col. 3:10; I Peter 1:14-16; I John 3:5-9). \r\n  \r\nI. Separation\r\n We believe that all the saved should live in such a manner as not to bring reproach upon their Savior and Lord; and, that separation from all religious apostasy, all worldy and sinful pleasures, practices and associations is commanded of God (II Tim. 3:1-5; Rom. 12:1-2; 14:13; I John 2:15-17; II John 9:11; II Cor. 6:14; 7:1). \r\n  \r\nJ. Missions\r\n We believe that it is the obligation of the saved to witness by life and by Word to the truths of Holy Scripture, and to seek to proclaim the Gospel to all mankind (Mark 16:15; Acts 1:8; II Cor. 5:19-20). \r\n  \r\nK. The Ministry and Spiritual Gifts\r\n 1. We believe that God is sovereign in the bestowment of all His gifts, and, that the gifts of evangelists, pastors, and teachers are sufficient for the perfecting of the saints today; and, that speaking in tongues and the working of sign miracles gradually ceased as the New Testament Scriptures were completed and their authority became established (I Cor. 12:4-11; II Cor. 12:12; Eph. 4:7-12). \r\n 2. We believe that God does hear and answer the prayer of faith, in accord with His own will, for the sick and afflicted (John 15:7; I John 5:14-15). \r\n  \r\nL. The Church\r\n 1. We believe that the Church, which is the body and the espoused bride of Christ, is a spiritual organism made up of all born-again persons of this present age (Eph. 1:22-23; 5:25-27; I Cor. 12:12-14; II Cor. 11:2). \r\n 2. We believe that the establishment and continuance of local churches is clearly taught and defined in the New Testament Scriptures (Acts 14:27; 20:27-32; I Tim. 3:1-13; Titus 1:5-11). \r\n 3. We believe in the autonomy of the local church free of any external control (Acts 13:1-4; 15:19-31; 20:28; Rom. 16:1,4; I Cor. 3:9,16; 5:4-7,12; I Peter 5:1-4). \r\n 4. We recognize the ordinances of water baptism by immersion and the Lord\'s supper as scriptural means of testimony for the church in this age (Matt. 28:19-20; Acts 2:41-42; 18:8; I Cor. 11:23-26). \r\n  \r\nM. Dispensationalism\r\n We believe that the Scriptures interpreted in their natural, literal sense reveal divinely determined dispensations or rules of life which define man\'s responsibilities in successive ages. These dispensations are not ways of salvation, but rather, divinely- ordered stewardships by which God directs man according to His purpose. Three of these - the age of law, the age of the Church, and the age of the millennial kingdom - are the subjects of detailed revelation in the Scriptures (John 1:17; I Cor. 9:17; II Cor. 3:9-18; Gal. 3:13-25; Eph. 1:10; 3:2-10; Col. 1:24-25; Heb. 7:19; Rev. 20:2-6). \r\n  \r\nN. The Personality of Satan\r\n We believe that Satan is a person, the author of sin and the cause of the fall; that he is the open and declared enemy of God and man; and, that he shall be eternally punished in the Lake of Fire (Job 1:6-7; Isa. 14:12-17; Matt. 4:2-11; 25:41; Rev. 20:10). \r\n  \r\nO. The Second Advent of Christ\r\n We believe in that \"Blessed Hope\": the personal, imminent, pretribulational and premillennial coming of the Lord Jesus Christ for His redeemed ones; and in His subsequent return to earth, with His saints, to establish His Millennial Kingdom (I Thess. 4:13-18; Zech. 14:4-11: Rev. 19:11-16; 20:1-6; I Thess. 1:10; 5:9; Rev. 3:10). \r\n  \r\nP. The Eternal State\r\n 1. We believe in the bodily resurrection of all men: the saved to eternal life, and the unsaved to judgement and everlasting punishment (Matt. 25:46; John 5:28-29; 11:25-26; Rev. 20:5-6, 12-13). \r\n 2. We believe that the souls of the redeemed are, at death, absent from the body and present with the Lord, where in conscious bliss they await the first resurrection, when spirit, soul, and body are reunited to be glorified forever with the Lord (Luke 23:43; Rev. 20:4-6; II Cor. 5:8; Phil. 1:23; I Thess. 4:16-17). \r\n 3. We believe that the souls of unbelievers remain, after death, in conscious misery until the second resurrection, when, with soul and body reunited, they shall appear at the Great White Throne Judgement, and shall be cast into the Lake of Fire, not to be annihilated, but to suffer everlasting conscious punish- ment (Luke 16:19-26; Matt. 25:41-46; II Thess. 1:7-9; Jude 6-7; Mark 9:43-48; Rev. 20:11-15). \r\n  \r\nQ. Movements Contrary to Biblical Faith\r\n We believe that these movements are out of harmony with the Word of God, and are inimical to the work of God: \r\n 1. Ecumenism \r\n Ecumenism is that movement which seeks the organizational unity of all Christianity, and, ultimately, of all religions. Its principal advocates are the World Council of Churches and the National Council of the Churches of Christ in the United States of America. \r\n 2. Ecumenical Evangelism \r\n Ecumenical Evangelism is that effort to promote the Gospel by bringing fundamentalists into an unequal yoke with theological liberals andor Roman Catholics and other divergent groups. \r\n 3. Neo-orthodoxy \r\n Neo-orthodoxy is that theological movement which affirms: the transcendence of God, the finiteness and sinfulness of man, and the necessity of supernatural divine revelation of truth; but, while using evangelical terminology, seriously departs from orthodoxy: in accepting religious experience as the criterion of truth, and in abandoning important fundamentals of the Christian faith. \r\n 4. New Evangelism (Neo-Evangelicalism, New Conservatism) \r\n These terms refer to that movement within evangelicalism characterized by a toleration of, and a dialogue with, theological liberalism. Its essence is seen in an emphasis upon the social application of the Gospel and weak or unclear doctrines of: the inspiration of Scripture, Biblical creationism, eschatology, dispensationalism, and separation. It is further characterized by an attempt to accommodate Biblical Christianity and make it acceptable to the modern mind. \r\n &nbsp;  ', 'Our Beliefs', '', '/about/our-beliefs', '2010-03-18 00:36:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('67', ' &nbsp; \r\nPhilosophy of Worship\r\nThe music ministry exists to glorify God by leading our experience of the gospel through the musical portion of our corporate worship. We seek to join quality music with biblical, gospel-centered lyrics for the edification of believers and for evangelization of the lost. \r\nOur music is characterized by: \r\n\r\nDoctrinally sound, gospel-centered lyrics\r\nBalanced instrumentation\r\nMulti-generational worship\r\n\r\nIf you would like to be involved&nbsp;contact the church office and ask for Pastor Mike Berry (951-781-8174).&nbsp;&nbsp; Or you can email Pastor Mike at&nbsp;mikeb@cornerstonebible.org. &nbsp;We are currently looking for helping with the Audio-Visual side of the ministry. \r\n&nbsp; \r\n&nbsp; \r\n&nbsp;  ', 'Our Worship', '', '/about/our-worship', '2010-03-18 00:36:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('68', '\"Believe in the Lord Jesus and you will be saved\" (Acts 16:31). &nbsp;\r\nThe Problem\r\n The Bible declares that we need to be saved. &nbsp;This implies that we have a problem we need to be rescued from. &nbsp;Scripture is clear that our problem is sin and the consequences of sin - death. &nbsp;Romans 3:23 says: \"all have sinned and fall short of the glory of God.\" &nbsp;Genesis says, \"the LORD saw that the wickedness of man was great on the earth, and that every intent of the thoughts of his heart was only evil continually\" (Genesis 6:5). &nbsp;The Bible is equally clear that the just penalty for our sin against God is death, both physical and eternal. &nbsp;\"For the wages of sin is death\" (Romans 6:23). &nbsp;\"But for the cowardly and unbelieving and abominable and murderers and immoral persons and sorcerers and idolaters and all liars, their part will be in the lake that burns with fire and brimstone, which is the second death\" (Revelation 21:8). \r\nThe Solution\r\n Without God\'s intervention, the situation regarding mankind\'s dilemma would be hopeless. &nbsp;But, God who is rich in mercy and love ordained from eternity past that He Himself would provide the solution by sending His own Son. &nbsp;\"But God demonstrates His own love toward us, in that while we were yet sinners, Christ died for us\" (Romans 5:8). &nbsp;Jesus Christ, God the Son, took upon Himself the wrath of God that we rightfully deserved to endure. &nbsp;Isaiah says: \"But He was pierced through for our transgressions, He was crushed for our iniquities; The chastening for our well-being fell upon Him, And by His scourging we are healed. &nbsp;All of us like sheep have gone astray, Each of us has turned to his own way; But the LORD has caused the iniquity of us all To fall on Him\" (Isaiah 53:5-6). &nbsp; \r\nThe Way\r\n The Bible declares that the benefits of Jesus Christ\'s death are can only be received by faith. &nbsp;We are called to place all of our faith in Jesus. &nbsp;\"Whoever believes in Him shall not perish, but have eternal life\" (John 3:16). &nbsp;To believe in Jesus is not only to believe the truth about Him but to entrust all of yourself to Him, depending upon Him entirely, not only for your salvation but your existence. &nbsp;To believe in Jesus means you turn away from your sin to follow Him in faith and obedience. &nbsp; \r\n   \r\n We would love to talk to you further about the amazing truth of Jesus and the gospel. \r\nIf you would like more information about Jesus and salvation let us know by completing the form below. &nbsp; ', 'Be Saved', '', '/get-involved/be-saved', '2010-03-18 00:37:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('69', ' \"Go therefore and make disciples of all the nations, baptizing them in the name of the Father and the Son and the Holy Spirit\" (Matthew 28:19). \r\n Baptism is Jesus\' desire for everyone who becomes His disciple. &nbsp;It serves as an outward demonstration of the realities experienced by all who have truly been born again. &nbsp;Scripture declares that all who have experienced salvation \"have been buried with Him through baptism into death, so that as Christ was raised from the dead through the glory of the Father, so we too might walk in newness of life\" (Romans 6:4). &nbsp;Thus being baptized into water pictures our death to our former way of life and the beginning of a transformed life. &nbsp; \r\n Baptism also serves to identify us as one with the Triune God. &nbsp;Through baptism we not only publicly portray the gospel but our own&nbsp;allegiance&nbsp;to Jesus Christ, God the Son, and the fact that we are His follower. &nbsp;Galatians 3:27 says: \"For all of you who were baptized into Christ have clothed yourselves with Christ.\" \r\n Baptism is thus an opportunity to publicly proclaim the gospel and our union with Jesus Christ. &nbsp;The Bible is clear that baptism is only a symbol and in now way saves us. &nbsp;Salvation is only received by faith in Jesus Christ. &nbsp; \r\n At Cornerstone, we practice believer\'s baptism, meaning we baptize only those who have professed faith in Jesus Christ. &nbsp;We also practice baptism by immersion, meaning we baptize believers in water by submerging them. &nbsp; \r\nIf you would like more information regarding baptism or would like to be baptized please fill out the form below.\r\n &nbsp;  ', 'Get Baptized', '', '/get-involved/get-baptized', '2010-03-18 00:37:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('70', 'Membership =&nbsp;Commitment. &nbsp;Becoming a member of Cornerstone simply means you are committing yourself to us and we are committing ourselves to you. &nbsp;Through membership, you are blessed as you place yourself under the care, instruction, and accountability of the elders and members of Cornerstone. &nbsp;Through membership, Cornerstone is blessed with your presence, gifts, and influence as you invest in the lives of those around you. &nbsp; \r\nGod intended for believers to become part of his body which is the church and to experience the richness of community that is found in committed relationships within local churches. Membership is the way for you as well as us to facilitate that community and commitment&nbsp;among&nbsp;one another. &nbsp; \r\nThough the Bible does not mention the word \"member\" or \"membership\" it does teach the idea of membership. &nbsp;The church of the New Testament would not have understood the concept of a Christian who was not associated with and committed to a local body of believers. &nbsp;Indeed, the language used to describe the church (body, flock, temple, household) evokes the idea of those who are a committed and vital part of that community. &nbsp;God\'s call on church leaders to care for His people&nbsp;necessitates&nbsp;that pastors/elders know who they are being called to shepherd, instruct, disciple, and guard (1 Peter 5:1-3; Acts 20:28; Matthew 18:15-17; 1 Corinthians 5). Likewise, God\'s call on members of the local church to follow and obey their leaders assumes that they have joined themselves to a local body of believers (Hebrews 13:17). \r\nOur desire is that everyone at Cornerstone would become a vital and committed member of the church. &nbsp;If you would like more information on membership, we would like to invite you to our next membership class. &nbsp; \r\nOur next Membership Class is:\r\nMay 16, 2010 - 12:30 - 3:30 p.m.\r\nRegister for the Membership Class to let us know your coming:\r\n\r\n ', 'Become a Member', '', '/get-involved/become-a-member', '2010-03-18 00:37:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('71', 'Care Groups are a vital part of Cornerstone. &nbsp;Each Care Group is a multi-generational gathering of 20-30 people who seek to glorify God by living out&nbsp;Our Mission&nbsp;as they pursue loving relationships and grow in community. &nbsp; \r\nCare Groups meet formally at least once a week for 2 to 3 hours. &nbsp;A typical Care Group meeting includes a time of Worship, Communion, Discussion, Prayer, and Fellowship. &nbsp;Through Care Groups we are able to practice the four values of Acts 2:42 - The Apostles\' Teaching, Fellowship, The Breaking of the Bread, and Prayer. &nbsp;Learn more about the four values&nbsp;by visiting&nbsp;Our Values&nbsp;page. &nbsp;Members of each Care Group also stay connected throughout the week in various ways including vial phone/email, hospitality, prayer, service projects, and community events. &nbsp; \r\nWe desire to see every member of Cornerstone actively involved in a Care Group. &nbsp;To learn more about Care Groups you can get in touch with our Care Group Pastor, Karlos Limtiaco and schedule a time to visit a few Care Groups. &nbsp;To see a list of current Care Groups check out our&nbsp;Care Groups - Current Groups&nbsp;page. &nbsp;  ', 'Join a Care Group', '', '/get-involved/join-a-care-group', '2010-03-18 00:37:00');
INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('72', 'We want every member of Cornerstone to be thoroughly equipped for every good work and every area of life. &nbsp;Our Equipping School exists to build you up in the Word of God and strengthen you to live out the glory of the gospel in all that God calls you to. &nbsp; \r\nFor those who are new to Cornerstone, we encourage you to attend our Core Classes. &nbsp;The Core Classes include _, _, _, which cover .... \r\nOnce you\'ve graduated from our Core Classes, Cornerstone invites you to be a part of our Growth Classes. &nbsp;Growth Classes are designed to build upon the foundational truths covered in the Core Classes and offer Cornerstone members continued opportunities to grow in their understanding of God\'s Word and its application to various areas of life. &nbsp;For a current list of Growth Classes, check out our &nbsp;page. &nbsp;  ', 'Get Equipped', '', '/get-involved/get-equipped', '2010-03-18 00:38:00');
