INSERT INTO `PageSearchIndex` (`cID`, `content`, `cName`, `cDescription`, `cPath`, `cDatePublic`) VALUES ('75', '\r\n\r\n\r\n\r\n\r\n\r\n \r\nThank you for visiting Cornerstone\'s website. We look forward to getting to know you as you get to know us. \r\nYou can find out more about Cornerstone, who we are, and what we are passionate about by browsing the links to the left, visiting our About page, and watching our Gospel Vision video here.  ', 'Welcome', '', '/i-m-new-here/welcome', '2010-03-18 21:32:00');
