INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('15', '<p><span style=\"font-size: large;\">Overview</span></p>\r\n<p><span style=\"font-family: helvetica;\"><br /></span></p>\r\n<p>\r\n<p><span style=\"font-size: small;\">Cornerstone is a Gospel-Centered Independent Bible Church. Our emphases are breathing the Gospel moment by moment and living the Gospel in word and deed; expository preaching; text-driven theology; mercy-laden outreach; sanctification in community; and Gospel-driven, multi-generational worship.</span></p>\r\n<p><span style=\"font-size: small;\"><br /></span></p>\r\n<p><span style=\"font-size: small;\">Are you looking for a church? The links on the left will direct you to detailed information about Cornerstone\'s doctrine and practice.</span></p>\r\n</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('16', '<p><span style=\"font-size: x-large;\">Overview</span></p>\r\n<p><span style=\"font-family: helvetica;\"><br /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">Cornerstone is a Gospel-Centered Independent Bible Church. Our emphases are breathing the Gospel moment by moment and living the Gospel in word and deed; expository preaching; text-driven theology; mercy-laden outreach; sanctification in community; and Gospel-driven, multi-generational worship.</span></p>\r\n<p><span style=\"font-size: medium;\"><br /></span></p>\r\n<p><span style=\"font-size: medium;\">Are you looking for a church? The links on the left will direct you to detailed information about Cornerstone\'s doctrine and practice.</span></p>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('17', '<p><span style=\"font-size: x-large;\">Overview</span></p>\r\n<p><span style=\"font-size: small;\"><br /></span></p>\r\n<p><span style=\"font-size: small;\">Cornerstone is a Gospel-Centered Independent Bible Church. Our emphases are breathing the Gospel moment by moment and living the Gospel in word and deed; expository preaching; text-driven theology; mercy-laden outreach; sanctification in community; and Gospel-driven, multi-generational worship.</span></p>\r\n<p><span style=\"font-size: small;\"><br /></span></p>\r\n<p><span style=\"font-size: small;\">Are you looking for a church? The links on the left will direct you to detailed information about Cornerstone\'s doctrine and practice.</span></p>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('18', '<p>\r\n<div>\r\n<p><span style=\"font-size: x-large;\">Overview</span></p>\r\n<p><span style=\"font-size: small;\"><br /></span></p>\r\n<p><span style=\"font-size: small;\">Cornerstone is a Gospel-Centered Independent Bible Church. Our emphases are breathing the Gospel moment by moment and living the Gospel in word and deed; expository preaching; text-driven theology; mercy-laden outreach; sanctification in </span></p>\r\n<p><span style=\"font-size: small;\">community; and Gospel-driven, multi-generational worship.</span></p>\r\n<p><span style=\"font-size: small;\"><br /></span></p>\r\n<p><span style=\"font-size: small;\">Are you looking for a church? The links on the left will direct you to detailed information about Cornerstone\'s doctrine and practice.</span></p>\r\n<div><span style=\"font-size: small;\"><br /></span></div>\r\n</div>\r\n</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('19', '<p><span style=\"font-size: x-large;\"><span style=\"font-family: helvetica;\">Our Mission</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">We exist to glorify God by:</span></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">Experiencing the gospel in all of its fullness</span></span></li>\r\n<li><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">Exalting the Lord through worship</span></span></li>\r\n<li><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">Edifying the saints through mutual ministry</span></span></li>\r\n<li><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">Evangelizing the world through outreach</span></span></li>\r\n</ul>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('31', '<p><span style=\"font-size: x-large;\">Location &amp; Services</span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">Sunday Service Times are:</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-size: medium;\">8:30 &amp; 10:30</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\"><br /></span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">We are located at:</span></span></p>\r\n<p><span><span style=\"font-size: medium;\">1363 W. Linden St. Riverside, CA 92507. &nbsp;</span></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('36', '<p><span style=\"font-size: x-large;\">Location &amp; Services</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">Sunday Service Times are:</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-size: medium;\">8:30 &amp; 10:30</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\"><br /></span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">We are located at:</span></span></p>\r\n<p><span style=\"font-size: medium;\">1363 W. Linden St. Riverside, CA 92507. &nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-small;\"><br /></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('38', '<p><span style=\"font-size: x-large;\"><span style=\"font-family: helvetica;\">Visitor\'s Reception</span></span></p>\r\n<p><span style=\"font-size: small;\">We want to invite you to join us for our next visitor\'s reception. &nbsp;This is a time for recent visitors to connect with some of the pastoral staff and learn more about Cornerstone. &nbsp;We usually meet right after our second service for a time of meet and greet, Q &amp; A, and refreshments. &nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\">Our next Visitor\'s Reception is:</span></p>\r\n<p><span style=\"font-size: small;\">March 28, 2010 from&nbsp;12:15-1:15 p.m.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\">Register for the Reception to let us know your coming.</span></p>\r\n<p><span style=\"font-size: x-small;\"><br /></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('40', '<p><span style=\"font-size: x-large;\"><span style=\"font-family: helvetica;\">Visitor\'s Reception</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\">We want to invite you to join us for our next visitor\'s reception. &nbsp;This is a time for recent visitors to connect with some of the pastoral staff and learn more about Cornerstone. &nbsp;We usually meet right after our second service for a time of meet and greet, Q &amp; A, and refreshments. &nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: large;\"><span style=\"font-size: small;\">Our next Visitor\'s Reception is:</span></span></p>\r\n<p><span style=\"font-size: large;\"><span style=\"font-family: helvetica;\"><strong>March 28, 2010 from&nbsp;12:15-1:15 p.m.</strong></span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\">Register for the Reception to let us know your coming.</span></p>\r\n<p><span style=\"font-size: x-small;\"><br /></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('41', '<p><span style=\"font-size: x-large;\"><span style=\"font-family: helvetica;\">What to Expect</span></span></p>\r\n<p><span style=\"font-size: x-small;\"><br /></span></p>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\">We encourage you to visit us for either of our Sunday Celebration Services. &nbsp;Our first service is from 8:30-10:00 a.m. and our second service is from 10:30-12:00 p.m. For directions see our <a title=\"Location &amp; Services\" href=\"{CCM:CID_61}\">Location &amp; Services</a>. &nbsp;</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Parking</span></span></p>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\">Upon your arrival, you are welcome to park in either our lower or upper parking lots. &nbsp;</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Children</span></span></p>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\">Children are welcome to participate in our entire service. &nbsp;Those who stay during our preaching time will receive \"kid\'s sermon notes\" and are encouraged to follow along as we study the Word. &nbsp;We also provide a full-range of Children\'s Ministry options including:</span></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Nursery &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (0-2 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</span></li>\r\n<li><span style=\"font-size: small;\">Toddler Care &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2-3 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</span></li>\r\n</ul>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Children\'s Church &nbsp; &nbsp; (4-9 years) &nbsp; &nbsp; &nbsp; &nbsp; 9:00-10:00 a.m.</span></li>\r\n</ul>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Worship Time &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 10:30-11:00 a.m.</span></li>\r\n<li><span style=\"font-size: small;\">Sunday School &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 11:00-1200 p.m.</span></li>\r\n</ul>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\">To learn more about Children\'s Ministry check out our <a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span><br /></span></p>\r\n<ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: medium;\">Adult</span></span></p>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\">Adults are encouraged to join us for our equipping school. &nbsp;We have classes offered during both services. &nbsp;To find out more about current classes being offered check out our&nbsp;<a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\"><br /></span></span></p>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\"><br /></span></span></p>');
