INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('49', '<p><span style=\"font-size: x-large;\">Welcome</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\">Thank you for visiting Cornerstone\'s website. &nbsp;We look forward to getting to know you as you get to know us. &nbsp;You can find out more about Cornerstone, who we are, and what we are passionate about by browsing the links to the left, visiting our&nbsp;<a title=\"About\" href=\"{CCM:CID_49}\">About</a>&nbsp;page, and watching our Gospel Vision video below.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\"><br /></span></p>');
