INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('52', '<p><span style=\"font-size: x-large;\">Jesus Christ</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">Who He Is</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">What He\'s Done</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">How We Must Respond</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\"><br /></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('53', '<p><span style=\"font-size: x-large;\">The Gospel</span></p>\r\n<p>&nbsp;</p>\r\n<p><!--StartFragment-->\r\n<p class=\"MsoNormal\"><span style=\"font-size: small;\">The Gospel literally means &ldquo;good news.&rdquo;&nbsp; In the Bible, the gospel is the good news regarding what God has been planning from eternity and accomplished in the person and work of Jesus Christ.&nbsp; </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: small;\">The gospel proclaims the beautiful truth that &hellip;..</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: small;\">Cornerstone is all about the gospel.&nbsp; Not only for salvation but for living every single moment.&nbsp;&nbsp;</span></p>\r\n<!--EndFragment--></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('54', '<p><span style=\"font-size: x-large;\">Welcome</span></p>\r\n<div style=\"float:right;\">\r\n<object width=\"400\" height=\"220\">\r\n<param name=\"allowfullscreen\" value=\"true\" />\r\n<param name=\"allowscriptaccess\" value=\"always\" />\r\n<param name=\"movie\" value=\"http://vimeo.com/moogaloop.swf?clip_id=5966916&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1\" /><embed type=\"application/x-shockwave-flash\" width=\"400\" height=\"220\" src=\"http://vimeo.com/moogaloop.swf?clip_id=5966916&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1\" allowfullscreen=\"true\" allowscriptaccess=\"always\"></embed>\r\n</object>\r\n</div>\r\n<p><span style=\"font-size: small;\">Thank you for visiting Cornerstone\'s website. &nbsp;We look forward to getting to know you as you get to know us. &nbsp;You can find out more about Cornerstone, who we are, and what we are passionate about by browsing the links to the left, visiting our&nbsp;<a title=\"About\" href=\"{CCM:CID_49}\">About</a>&nbsp;page, and watching our Gospel Vision video below.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\"><br /></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('56', '<h1><span style=\"font-size: x-large;\">Location &amp; Services</span></h1>\r\n<p><span style=\"font-family: helvetica; font-size: small; \">Sunday Service Times are:</span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-size: medium;\">8:30am &amp; 10:30 am</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\"><br /></span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">We are located at:</span></span></p>\r\n<p><span style=\"font-size: medium;\">1363 W. Linden St. Riverside, CA 92507. &nbsp;</span></p>\r\n<p><span style=\"font-size: medium;\"><br /></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('57', '<h1>Become a Member</h1>\r\n<p>&nbsp;</p>\r\n<p>Text</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('58', '<p><span style=\"font-size: x-large;\">Overview</span></p>\r\n<p><span style=\"font-size: small;\"><br /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\">Cornerstone is a Gospel-Centered Independent Bible Church. Our emphases are breathing the Gospel moment by moment and living the Gospel in word and deed; expository preaching; text-driven theology; mercy-laden outreach; sanctification in community; and Gospel-driven, multi-generational worship.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\"><br /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\">Are you looking for a church? The links on the left will direct you to detailed information about Cornerstone\'s doctrine and practice.</span></p>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('59', '<h1>Become a Member</h1>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong>Membership =&nbsp;Commitment</strong>. &nbsp;Becoming a member of Cornerstone simply means you are committing yourself to us and we are committing ourselves to you. &nbsp;Through membership, you are blessed as you place yourself under the care, instruction, and accountability of the elders and Cornerstone family. &nbsp;Through membership, Cornerstone is blessed with your presence, gifts, and influence as you invest in the lives of those around you. &nbsp;God intended for believers to become part of his body which is the church and to experience the richness of community that is found in committed relationships within local churches. &nbsp;Membership is the way for you as well as us to facilitate that community and commitment&nbsp;among&nbsp;one another. &nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Though the Bible does not mention the word \"member\" or \"membership\" <strong>it does teach the idea of membership</strong>. &nbsp;</p>\r\n<ul>\r\n<li></li>\r\n</ul>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('61', '<div style=\"float:right;\">\r\n<object width=\"400\" height=\"220\">\r\n<param name=\"allowfullscreen\" value=\"true\" />\r\n<param name=\"allowscriptaccess\" value=\"always\" />\r\n<param name=\"movie\" value=\"http://vimeo.com/moogaloop.swf?clip_id=5966916&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1\" /><embed type=\"application/x-shockwave-flash\" width=\"400\" height=\"220\" src=\"http://vimeo.com/moogaloop.swf?clip_id=5966916&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1\" allowscriptaccess=\"always\" allowfullscreen=\"true\"></embed>\r\n</object>\r\n</div>\r\n<p>Thank you for visiting Cornerstone\'s website. We look forward to getting to know you as you get to know us. You can find out more about Cornerstone, who we are, and what we are passionate about by browsing the links to the left, visiting our&nbsp;<a title=\"About\" href=\"{CCM:CID_49}\">About</a> page, and watching our Gospel Vision video here.</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('62', '<h1><span style=\"font-family: helvetica, Arial, sans-serif; font-weight: normal; font-size: small;\">Sunday Service Times are:</span></h1>\r\n<p><span style=\"font-size: small;\"><span style=\"font-size: medium;\">8:30am &amp; 10:30 am</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\"><br /></span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: helvetica;\">We are located at:</span></span></p>\r\n<p><span style=\"font-size: medium;\">1363 W. Linden St. Riverside, CA 92507. &nbsp;</span></p>\r\n<p><span style=\"font-size: medium;\"><br /></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('63', '<h2>Who He Is</h2>\r\n<p>&nbsp;</p>\r\n<h2>What He\'s Done</h2>\r\n<p>&nbsp;</p>\r\n<h2>How We Must Respond</h2>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('64', '<p><span style=\"font-size: small;\">We encourage you to visit us for either of our Sunday Celebration Services. &nbsp;Our first service is from 8:30-10:00 a.m. and our second service is from 10:30-12:00 p.m. For directions see our <a title=\"Location &amp; Services\" href=\"{CCM:CID_61}\">Location &amp; Services</a>. &nbsp;</span></p>\r\n<h2><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Parking</span></span></h2>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\">Upon your arrival, you are welcome to park in either our lower or upper parking lots. &nbsp;</span></span></p>\r\n<h2><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Children</span></span></h2>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\">Children are welcome to participate in our entire service. &nbsp;Those who stay during our preaching time will receive \"kid\'s sermon notes\" and are encouraged to follow along as we study the Word. &nbsp;We also provide a full-range of Children\'s Ministry options including:</span></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Nursery &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (0-2 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</span></li>\r\n<li><span style=\"font-size: small;\">Toddler Care &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2-3 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</span></li>\r\n</ul>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Children\'s Church &nbsp; &nbsp; (4-9 years) &nbsp; &nbsp; &nbsp; &nbsp; 9:00-10:00 a.m.</span></li>\r\n</ul>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Worship Time &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 10:30-11:00 a.m.</span></li>\r\n<li><span style=\"font-size: small;\">Sunday School &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 11:00-1200 p.m.</span></li>\r\n</ul>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\">To learn more about Children\'s Ministry check out our <a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<h2><span style=\"font-size: x-small;\"><span style=\"font-size: medium;\">Adult</span></span></h2>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\">Adults are encouraged to join us for our equipping school. &nbsp;We have classes offered during both services. &nbsp;To find out more about current classes being offered check out our&nbsp;<a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\"><br /></span></span></p>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\"><br /></span></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('68', '<p>Cornerstone is a Gospel-Centered Independent Bible Church. Our emphases are breathing the Gospel moment by moment and living the Gospel in word and deed; expository preaching; text-driven theology; mercy-laden outreach; sanctification in&nbsp;community; and Gospel-driven, multi-generational worship.</p>\r\n<div>\r\n<p>Are you looking for a church? The links on the left will direct you to detailed information about Cornerstone\'s doctrine and practice.</p>\r\n</div>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('69', '<p>We exist to glorify God by:</p>\r\n<ul>\r\n<li>Experiencing the gospel in all of its fullness</li>\r\n<li>Exalting the Lord through worship&gt;</li>\r\n<li>Edifying the saints through mutual ministry</li>\r\n<li>Evangelizing the world through outreach</li>\r\n</ul>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('70', '<h2>We exist to glorify God by:</h2>\r\n<ul>\r\n<li>Experiencing the gospel in all of its fullness</li>\r\n<li>Exalting the Lord through worship&gt;</li>\r\n<li>Edifying the saints through mutual ministry</li>\r\n<li>Evangelizing the world through outreach</li>\r\n</ul>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('71', '<p>The Gospel literally means &ldquo;good news.&rdquo;&nbsp; In the Bible, the gospel is the good news regarding what God has been planning from eternity and accomplished in the person and work of Jesus Christ.</p>\r\n<p>The gospel proclaims the beautiful truth that &hellip;</p>\r\n<p>Cornerstone is all about the gospel.  Not only for salvation but for living every single moment.</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('72', '<p>We want to invite you to join us for our next visitor\'s reception. &nbsp;This is a time for recent visitors to connect with some of the pastoral staff and learn more about Cornerstone. &nbsp;We usually meet right after our second service for a time of meet and greet, Q &amp; A, and refreshments.</p>\r\n<p>Our next Visitor\'s Reception is:</p>\r\n<h3>March 28, 2010 from&nbsp;12:15-1:15 p.m.</h3>\r\n<p>Register for the Reception to let us know you\'re coming:</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('75', '<div style=\"float:right;\">\r\n<object width=\"400\" height=\"220\">\r\n<param name=\"allowfullscreen\" value=\"true\" />\r\n<param name=\"allowscriptaccess\" value=\"always\" />\r\n<param name=\"movie\" value=\"http://vimeo.com/moogaloop.swf?clip_id=5966916&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1\" /><embed type=\"application/x-shockwave-flash\" width=\"400\" height=\"220\" src=\"http://vimeo.com/moogaloop.swf?clip_id=5966916&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1\" allowfullscreen=\"true\" allowscriptaccess=\"always\"></embed>\r\n</object>\r\n</div>\r\n<p>Thank you for visiting Cornerstone\'s website. We look forward to getting to know you as you get to know us. You can find out more about Cornerstone, who we are, and what we are passionate about by browsing the links to the left, visiting our&nbsp;<a title=\"About\" href=\"{CCM:CID_49}\">About</a> page, and watching our Gospel Vision video here.\r\n<hr />\r\n</p>');
