INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('82', '<p><span style=\"font-size: small;\">We encourage you to visit us for either of our Sunday Celebration Services. &nbsp;Our first service is from 8:30-10:00 a.m. and our second service is from 10:30-12:00 p.m. For directions see our <a title=\"Location &amp; Services\" href=\"{CCM:CID_61}\">Location &amp; Services</a>. &nbsp;</span></p>\r\n<h2><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Parking</span></span></h2>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\">Upon your arrival, you are welcome to park in either our lower or upper parking lots. &nbsp;</span></span></p>\r\n<h2><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Children</span></span></h2>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\">Children are welcome to participate in our entire service. &nbsp;Those who stay during our preaching time will receive \"kid\'s sermon notes\" and are encouraged to follow along as we study the Word. &nbsp;We also provide a full-range of Children\'s Ministry options including:</span></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Nursery &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (0-2 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</span></li>\r\n<li><span style=\"font-size: small;\">Toddler Care &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2-3 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</span></li>\r\n<li><span style=\"font-size: small;\">Children\'s Church &nbsp; &nbsp; (4-9 years) &nbsp; &nbsp; &nbsp; &nbsp; 9:00-10:00 a.m.</span></li>\r\n<li><span style=\"font-size: small;\">Worship Time &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 10:30-11:00 a.m.</span></li>\r\n<li><span style=\"font-size: small;\">Sunday School &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 11:00-1200 p.m.</span></li>\r\n</ul>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\">To learn more about Children\'s Ministry check out our <a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<h2><span style=\"font-size: x-small;\"><span style=\"font-size: medium;\">Adult</span></span></h2>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\">Adults are encouraged to join us for our equipping school. &nbsp;We have classes offered during both services. &nbsp;To find out more about current classes being offered check out our&nbsp;<a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\"><br /></span></span></p>\r\n<p><span style=\"font-size: x-large;\"><span style=\"font-size: small;\"><br /></span></span></p>');
