INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('87', '<h1><span style=\"color: #535558; font-size: 14px; line-height: 21px;\"><strong>Membership =&nbsp;Commitment</strong>. &nbsp;Becoming a member of Cornerstone simply means you are committing yourself to us and we are committing ourselves to you. &nbsp;Through membership, you are blessed as you place yourself under the care, instruction, and accountability of the elders and Cornerstone family. &nbsp;Through membership, Cornerstone is blessed with your presence, gifts, and influence as you invest in the lives of those around you. &nbsp;God intended for believers to become part of his body which is the church and to experience the richness of community that is found in committed relationships within local churches. &nbsp;Membership is the way for you as well as us to facilitate that community and commitment&nbsp;among&nbsp;one another. &nbsp;</span></h1>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Though the Bible does not mention the word \"member\" or \"membership\" <strong>it does teach the idea of membership</strong>. &nbsp;</p>\r\n<ul>\r\n</ul>');
