INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('89', '<p>We encourage you to visit us for either of our Sunday Celebration Services. &nbsp;Our first service is from 8:30-10:00 a.m. and our second service is from 10:30-12:00 p.m. For directions see our <a title=\"Location &amp; Services\" href=\"{CCM:CID_61}\">Location &amp; Services</a>. &nbsp;</p>\r\n<h2><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Parking</span></span></h2>\r\n<p>Upon your arrival, you are welcome to park in either our lower or upper parking lots. &nbsp;</p>\r\n<h2><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Children</span></span></h2>\r\n<p>Children are welcome to participate in our entire service. &nbsp;Those who stay during our preaching time will receive \"kid\'s sermon notes\" and are encouraged to follow along as we study the Word. &nbsp;We also provide a full-range of Children\'s Ministry options including:</p>\r\n<ul>\r\n<li>Nursery &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (0-2 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</li>\r\n<li>Toddler Care &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2-3 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</li>\r\n<li>Children\'s Church &nbsp; &nbsp; (4-9 years) &nbsp; &nbsp; &nbsp; &nbsp; 9:00-10:00 a.m.</li>\r\n<li>Worship Time &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 10:30-11:00 a.m.</li>\r\n<li>Sunday School &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 11:00-1200 p.m.</li>\r\n</ul>\r\n<p>To learn more about Children\'s Ministry check out our <span style=\"font-size: x-small;\"><span style=\"font-size: small;\"><a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<h2><span style=\"font-size: x-small;\"><span style=\"font-size: medium;\">Adult</span></span></h2>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\">Adults are encouraged to join us for our equipping school. &nbsp;We have classes offered during both services. &nbsp;To find out more about current classes being offered check out our&nbsp;<a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('90', '<p>&nbsp;</p>\r\n<h3>A. The Holy Scriptures</h3>\r\n<p>We believe the Holy Scriptures of the Old and New Testaments to be the verbally-inspired Word of God, the final authority for faith and life, inerrant in the original writings, infallible and God-breathed (II Tim. 3:16-17; II Peter 1:20-21; Matt. 5:18; John 16:12-13).</p>\r\n<p><a name=\"God\"></a></p>\r\n<h3>B. The Godhead</h3>\r\n<p>We believe in one Triune God, eternally existing in three Persons - Father, Son, and Holy Spirit - co-eternal in being, co-identical in nature, co-equal in power and glory, and having the same attributes and perfections (Deut. 6:4; II Cor. 13:14).</p>\r\n<p><a name=\"Christ\"></a></p>\r\n<h3>C. The Person and Work of Christ</h3>\r\n<p>1. We believe that the Lord Jesus Christ, the eternal Son of God, became man, without ceasing to be God, having been conceived by the Holy Spirit and born of the Virgin Mary, in order that He might reveal God and redeem sinful men (John 1:1,2,14; Luke 1:35).</p>\r\n<p>2. We believe that the Lord Jesus Christ accomplished our redemption through His death on the cross as a representative, vicarious, substitutionary sacrifice; and, that our justification is made sure by His literal physical resurrection from the dead (Rom. 3:24-25; I Peter 2:24; Eph. 1:7; I Peter 1:3-5).</p>\r\n<p>3. We believe that the Lord Jesus Christ ascended to heaven and is now exalted at the right hand of God, where, as our High Priest, He fulfills the ministry of Representative, Intercessor, and Advocate (Acts 1:9-10; Heb. 9:24; 7:25; Rom. 8:34; I John 2:1-2).</p>\r\n<p><a name=\"holyspirit\"></a></p>\r\n<h3>D. The Person and Work of the Holy Spirit</h3>\r\n<p>1. We believe that the Holy Spirit is a person who convicts the world of sin, of righteousness, and of judgement; and, that He is the supernatural Agent in regeneration, baptizing all believers into the Body of Christ, indwelling and sealing them unto the day of redemption (John 16:8-11; II Cor. 3:6; I Cor. 12:12-14; Rom. 8:9; Eph. 1:13-14).</p>\r\n<p>2. We believe that He is the Divine Teacher who guides believers into all truth; and, that it is the privilege and duty of all the saved to be filled with the Spirit (John 16:13; I John 2:20, 27; Eph. 5:18).</p>\r\n<p><a name=\"depravity\"></a></p>\r\n<h3>E. The Total Depravity of Man</h3>\r\n<p>We believe that man was created in the image and likeness of God, but in Adam\'s sin the race fell, inherited a sinful nature, and became alienated from God; and, that man is totally depraved, and, of himself, utterly unable to remedy his lost condition (Gen. 1:26-27; Rom 3:22-23; 5:12; Eph. 2:1-3,12).</p>\r\n<p><a name=\"salvation\"></a></p>\r\n<h3>F. Salvation</h3>\r\n<p>We believe that salvation is the gift of God brought to man by grace and received by personal faith in the Lord Jesus Christ, whose precious blood was shed on Calvary for the forgiveness of our sins (Eph. 2:8-10; John 1:12; Eph. 1:7; I Peter 1:18-19).</p>\r\n<p><a name=\"security\"></a></p>\r\n<h3>G. The Eternal Security and Assurance of Believers</h3>\r\n<p>1. We believe that all the redeemed, once saved, are kept by God\'s power and are thus secure in Christ forever (John 6:37-40; 10:27-30; Rom. 8:1,38-39; I Cor. 1:4-8; I Peter 1:5).</p>\r\n<p>2. We believe that it is the privilege of believers to rejoice in the assurance of salvation through the testimony of God\'s Word; which, however, clearly forbids the use of Christian liberty as an occasion to the flesh (Rom 13:13-14; Gal. 5:13; Titus 2:11-15).</p>\r\n<p><a name=\"twonatures\"></a></p>\r\n<h3>H. The Two Natures of the Believer</h3>\r\n<p>We believe that every saved person posseses two natures, with provision made for victory of the new nature over the old nature through the power of the indwelling Holy Spirit; and, that all claims to the eradication of the old nature in this life are unscriptural (Rom. 6:13; 8:12-13; Gal. 5:16-25; Eph. 4:22-24; Col. 3:10; I Peter 1:14-16; I John 3:5-9).</p>\r\n<p><a name=\"separation\"></a></p>\r\n<h3>I. Separation</h3>\r\n<p>We believe that all the saved should live in such a manner as not to bring reproach upon their Savior and Lord; and, that separation from all religious apostasy, all worldy and sinful pleasures, practices and associations is commanded of God (II Tim. 3:1-5; Rom. 12:1-2; 14:13; I John 2:15-17; II John 9:11; II Cor. 6:14; 7:1).</p>\r\n<p><a name=\"missions\"></a></p>\r\n<h3>J. Missions</h3>\r\n<p>We believe that it is the obligation of the saved to witness by life and by Word to the truths of Holy Scripture, and to seek to proclaim the Gospel to all mankind (Mark 16:15; Acts 1:8; II Cor. 5:19-20).</p>\r\n<p><a name=\"gifts\"></a></p>\r\n<h3>K. The Ministry and Spiritual Gifts</h3>\r\n<p>1. We believe that God is sovereign in the bestowment of all His gifts, and, that the gifts of evangelists, pastors, and teachers are sufficient for the perfecting of the saints today; and, that speaking in tongues and the working of sign miracles gradually ceased as the New Testament Scriptures were completed and their authority became established (I Cor. 12:4-11; II Cor. 12:12; Eph. 4:7-12).</p>\r\n<p>2. We believe that God does hear and answer the prayer of faith, in accord with His own will, for the sick and afflicted (John 15:7; I John 5:14-15).</p>\r\n<p><a name=\"church\"></a></p>\r\n<h3>L. The Church</h3>\r\n<p>1. We believe that the Church, which is the body and the espoused bride of Christ, is a spiritual organism made up of all born-again persons of this present age (Eph. 1:22-23; 5:25-27; I Cor. 12:12-14; II Cor. 11:2).</p>\r\n<p>2. We believe that the establishment and continuance of local churches is clearly taught and defined in the New Testament Scriptures (Acts 14:27; 20:27-32; I Tim. 3:1-13; Titus 1:5-11).</p>\r\n<p>3. We believe in the autonomy of the local church free of any external control (Acts 13:1-4; 15:19-31; 20:28; Rom. 16:1,4; I Cor. 3:9,16; 5:4-7,12; I Peter 5:1-4).</p>\r\n<p>4. We recognize the ordinances of water baptism by immersion and the Lord\'s supper as scriptural means of testimony for the church in this age (Matt. 28:19-20; Acts 2:41-42; 18:8; I Cor. 11:23-26).</p>\r\n<p><a name=\"dispensationalism\"></a></p>\r\n<h3>M. Dispensationalism</h3>\r\n<p>We believe that the Scriptures interpreted in their natural, literal sense reveal divinely determined dispensations or rules of life which define man\'s responsibilities in successive ages. These dispensations are not ways of salvation, but rather, divinely- ordered stewardships by which God directs man according to His purpose. Three of these - the age of law, the age of the Church, and the age of the millennial kingdom - are the subjects of detailed revelation in the Scriptures (John 1:17; I Cor. 9:17; II Cor. 3:9-18; Gal. 3:13-25; Eph. 1:10; 3:2-10; Col. 1:24-25; Heb. 7:19; Rev. 20:2-6).</p>\r\n<p><a name=\"satan\"></a></p>\r\n<h3>N. The Personality of Satan</h3>\r\n<p>We believe that Satan is a person, the author of sin and the cause of the fall; that he is the open and declared enemy of God and man; and, that he shall be eternally punished in the Lake of Fire (Job 1:6-7; Isa. 14:12-17; Matt. 4:2-11; 25:41; Rev. 20:10).</p>\r\n<p><a name=\"advent\"></a></p>\r\n<h3>O. The Second Advent of Christ</h3>\r\n<p>We believe in that \"Blessed Hope\": the personal, imminent, pretribulational and premillennial coming of the Lord Jesus Christ for His redeemed ones; and in His subsequent return to earth, with His saints, to establish His Millennial Kingdom (I Thess. 4:13-18; Zech. 14:4-11: Rev. 19:11-16; 20:1-6; I Thess. 1:10; 5:9; Rev. 3:10).</p>\r\n<p><a name=\"eternity\"></a></p>\r\n<h3>P. The Eternal State</h3>\r\n<p>1. We believe in the bodily resurrection of all men: the saved to eternal life, and the unsaved to judgement and everlasting punishment (Matt. 25:46; John 5:28-29; 11:25-26; Rev. 20:5-6, 12-13).</p>\r\n<p>2. We believe that the souls of the redeemed are, at death, absent from the body and present with the Lord, where in conscious bliss they await the first resurrection, when spirit, soul, and body are reunited to be glorified forever with the Lord (Luke 23:43; Rev. 20:4-6; II Cor. 5:8; Phil. 1:23; I Thess. 4:16-17).</p>\r\n<p>3. We believe that the souls of unbelievers remain, after death, in conscious misery until the second resurrection, when, with soul and body reunited, they shall appear at the Great White Throne Judgement, and shall be cast into the Lake of Fire, not to be annihilated, but to suffer everlasting conscious punish- ment (Luke 16:19-26; Matt. 25:41-46; II Thess. 1:7-9; Jude 6-7; Mark 9:43-48; Rev. 20:11-15).</p>\r\n<p><a name=\"movements\"></a></p>\r\n<h3>Q. Movements Contrary to Biblical Faith</h3>\r\n<p>We believe that these movements are out of harmony with the Word of God, and are inimical to the work of God:</p>\r\n<p>1. Ecumenism</p>\r\n<p>Ecumenism is that movement which seeks the organizational unity of all Christianity, and, ultimately, of all religions. Its principal advocates are the World Council of Churches and the National Council of the Churches of Christ in the United States of America.</p>\r\n<p>2. Ecumenical Evangelism</p>\r\n<p>Ecumenical Evangelism is that effort to promote the Gospel by bringing fundamentalists into an unequal yoke with theological liberals andor Roman Catholics and other divergent groups.</p>\r\n<p>3. Neo-orthodoxy</p>\r\n<p>Neo-orthodoxy is that theological movement which affirms: the transcendence of God, the finiteness and sinfulness of man, and the necessity of supernatural divine revelation of truth; but, while using evangelical terminology, seriously departs from orthodoxy: in accepting religious experience as the criterion of truth, and in abandoning important fundamentals of the Christian faith.</p>\r\n<p>4. New Evangelism (Neo-Evangelicalism, New Conservatism)</p>\r\n<p>These terms refer to that movement within evangelicalism characterized by a toleration of, and a dialogue with, theological liberalism. Its essence is seen in an emphasis upon the social application of the Gospel and weak or unclear doctrines of: the inspiration of Scripture, Biblical creationism, eschatology, dispensationalism, and separation. It is further characterized by an attempt to accommodate Biblical Christianity and make it acceptable to the modern mind.</p>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('91', '<p style=\"text-align: justify;\">Cornerstone is a Gospel-Centered Independent Bible Church. Our emphases are breathing the Gospel moment by moment and living the Gospel in word and deed; expository preaching; text-driven theology; mercy-laden outreach; sanctification in&nbsp;community; and Gospel-driven, multi-generational worship.</p>\r\n<div style=\"text-align: justify;\">\r\n<p style=\"text-align: justify;\">Are you looking for a church? The links on the left will direct you to detailed information about Cornerstone\'s doctrine and practice.</p>\r\n</div>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('92', '<p>&nbsp;</p>\r\n<h2>PHILOSOPHY OF WORSHIP</h2>\r\n<p>The music ministry exists to glorify God by leading our experience of the gospel through the musical portion of our corporate worship. We seek to join quality music with biblical, gospel-centered lyrics for the edification of believers and for evangelization of the lost.</p>\r\n<p>Our music is characterized by:</p>\r\n<ul>\r\n<li>Doctrinally sound, gospel-centered lyrics</li>\r\n<li>Balanced instrumentation</li>\r\n<li>Multi-generational worship</li>\r\n</ul>\r\n<p>If you would like to be involved&nbsp;contact the church office and ask for Pastor Mike Berry (951-781-8174).&nbsp;&nbsp; Or you can email Pastor Mike at&nbsp;<a href=\"mailto:mikeb@cornerstonebible.org\">mikeb@cornerstonebible.org</a>. &nbsp;We are currently looking for helping with the Audio-Visual side of the ministry.</p>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('93', '<p>&nbsp;</p>\r\n<h2>PHILOSOPHY OF WORSHIP</h2>\r\n<p style=\"text-align: justify;\">The music ministry exists to glorify God by leading our experience of the gospel through the musical portion of our corporate worship. We seek to join quality music with biblical, gospel-centered lyrics for the edification of believers and for evangelization of the lost.</p>\r\n<p style=\"text-align: justify;\">Our music is characterized by:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Doctrinally sound, gospel-centered lyrics</li>\r\n<li>Balanced instrumentation</li>\r\n<li>Multi-generational worship</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">If you would like to be involved&nbsp;contact the church office and ask for Pastor Mike Berry (951-781-8174).&nbsp;&nbsp; Or you can email Pastor Mike at&nbsp;<a href=\"mailto:mikeb@cornerstonebible.org\">mikeb@cornerstonebible.org</a>. &nbsp;We are currently looking for helping with the Audio-Visual side of the ministry.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('94', '<h2><span style=\"color: #007db0; line-height: normal; font-size: 18px; \">We exist to glorify God by:</span></h2>\r\n<ul>\r\n<li>Experiencing the gospel in all of its fullness</li>\r\n<li>Exalting the Lord through worship</li>\r\n<li>Edifying the saints through mutual ministry</li>\r\n<li>Evangelizing the world through outreach</li>\r\n</ul>\r\n<p><span style=\"font-size: small;\"></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\">\r\n<p>Our mission statement guides all that Cornerstone does and is passionate about. &nbsp;The Bible gives us our ultimate mission - to glorify God. &nbsp;Romans 11:36 says \"Romans 11:36 &nbsp;For from Him and through Him and to Him are all things. To Him be the glory forever. Amen.\"</p>\r\n<h2>Experiencing the Gospel in all of its Fullness</h2>\r\n<p>Cornerstone seeks to glorify God by individually and corporately experiencing the power and wonder of the gospel in our own lives and together with one another. &nbsp;We do this by daily rehearsing and living inside of the gospel. &nbsp;As we are consumed by the gospel and moved by its power, we find ourselves&nbsp;</p>\r\n<h2>Exalting the Lord through Worship</h2>\r\n<p>Cornerstone seeks to glorify God by individually and corporately exalting the Lord through worship. &nbsp;We do this as individuals by each living a life that makes much of Jesus. &nbsp;Exalting the Lord continues in our homes as families daily gather to praise and magnify God together in family worship. &nbsp;Finally, each Sunday, Cornerstone corporately gathers to exalt the Lord through worship in song and the study of His Word. &nbsp;</p>\r\n<h2>Edifying the Saints through Mutual Ministry</h2>\r\n<p>Cornerstone seeks to glorify God by equipping each believer to serve Him with their entire lives. &nbsp;This includes providing opportunities for edification, instruction, accountability, and service. &nbsp;We do this through among other things our Sunday service, Care Group ministry, and weekday Bible studies. &nbsp;</p>\r\n<h2>Evangelizing the World through Outreach</h2>\r\n<p>Cornerstone seeks to glorify God by evangelizing the world through outreach. &nbsp;Our desire is to proclaim the power of the gospel through our words and lives to those who know Jesus Christ and those who do not. &nbsp;We do this as individuals, families, Care Groups, and missionaries. &nbsp;Our goal is to take the gospel across the street and around the world. &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n</ul>');
