 through Outreach</h2>\r\n<p>Cornerstone seeks to glorify God by evangelizing the world through outreach. &nbsp;Our desire is to proclaim the power of the gospel through our words and lives to those who know Jesus Christ and those who do not. &nbsp;We do this as individuals, families, Care Groups, and missionaries. &nbsp;Our goal is to take the gospel across the street and around the world. &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n</ul>');
