 each believer to serve Him with their entire lives. &nbsp;This includes providing opportunities for edification, instruction, accountability, and service. &nbsp;We do this through among other things our Sunday service, Care Group ministry, and weekday Bible studies. &nbsp;</p>\r\n<h2 style=\"text-align: justify;\">Evangelizing the World through Outreach</h2>\r\n<p style=\"text-align: justify;\">Cornerstone seeks to glorify God by evangelizing the world through outreach. &nbsp;Our desire is to proclaim the power of the gospel through our words and lives to those who know Jesus Christ and those who do not. &nbsp;We do this as individuals, families, Care Groups, and missionaries. &nbsp;Our goal is to take the gospel across the street and around the world.</p>\r\n<ul>\r\n</ul>');
