INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('100', '<p>&nbsp;</p>\r\n<h2>Philosophy of Worship</h2>\r\n<p style=\"text-align: justify;\">The music ministry exists to glorify God by leading our experience of the gospel through the musical portion of our corporate worship. We seek to join quality music with biblical, gospel-centered lyrics for the edification of believers and for evangelization of the lost.</p>\r\n<p style=\"text-align: justify;\">Our music is characterized by:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Doctrinally sound, gospel-centered lyrics</li>\r\n<li>Balanced instrumentation</li>\r\n<li>Multi-generational worship</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">If you would like to be involved&nbsp;contact the church office and ask for Pastor Mike Berry (951-781-8174).&nbsp;&nbsp; Or you can email Pastor Mike at&nbsp;<a href=\"mailto:mikeb@cornerstonebible.org\">mikeb@cornerstonebible.org</a>. &nbsp;We are currently looking for helping with the Audio-Visual side of the ministry.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('101', '<h2>Sunday Service Times are:</h2>\r\n<p>8:30 am &amp; 10:30 am</p>\r\n<h2>We are located at:</h2>\r\n<p>1363 W. Linden St. Riverside, CA 92507</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('103', '<p>We encourage you to visit us for either of our Sunday Celebration Services. &nbsp;Our first service is from 8:30-10:00 a.m. and our second service is from 10:30-12:00 p.m. For directions see our <a title=\"Location &amp; Services\" href=\"{CCM:CID_61}\">Location &amp; Services</a>. &nbsp;</p>\r\n<h2><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Parking</span></span></h2>\r\n<p>Upon your arrival, you are welcome to park in either our lower or upper parking lots. &nbsp;</p>\r\n<h2><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Children</span></span></h2>\r\n<p>Children are welcome to participate in our entire service. &nbsp;Those who stay during our preaching time will receive \"kid\'s sermon notes\" and are encouraged to follow along as we study the Word. &nbsp;We also provide a full-range of Children\'s Ministry options including:</p>\r\n<ul>\r\n<li>Nursery &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (0-2 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</li>\r\n<li>Toddler Care &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2-3 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</li>\r\n<li>Children\'s Church &nbsp; &nbsp; (4-9 years) &nbsp; &nbsp; &nbsp; &nbsp; 9:00-10:00 a.m.</li>\r\n<li>Worship Time &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 10:30-11:00 a.m.</li>\r\n<li>Sunday School &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 11:00-1200 p.m.</li>\r\n</ul>\r\n<p>To learn more about Children\'s Ministry check out our <span style=\"font-size: x-small;\"><span style=\"font-size: small;\"><a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<h2><span style=\"font-size: x-small;\"><span style=\"font-size: medium;\">Adult</span></span></h2>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\">Adults are encouraged to join us for our equipping school. &nbsp;We have classes offered during both services. &nbsp;To find out more about current classes being offered check out our&nbsp;<a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-size: small;\"><br /></span></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('104', '<p>The Bible says: \"Believe in the Lord Jesus and you will be saved\" (Acts 16:31). &nbsp;</p>\r\n<h2>The Problem</h2>\r\n<p>The Bible declares that we need to be saved. &nbsp;This implies that we have a problem we need to be rescued from. &nbsp;Scripture is clear that our problem is sin and the consequences of sin - death. &nbsp;Romans 3:23 says: \"all have sinned and fall short of the glory of God.\" &nbsp;Genesis says, \"the LORD saw that the wickedness of man was great on the earth, and that every intent of the thoughts of his heart was only evil continually\" (Genesis 6:5). &nbsp;The Bible is equally clear that the just penalty for our sin against God is death, both physical and eternal. &nbsp;\"For the wages of sin is death\" (Romans 6:23). &nbsp;\"But for the cowardly and unbelieving and abominable and murderers and immoral persons and sorcerers and idolaters and all liars, their part will be in the lake that burns with fire and brimstone, which is the second death\" (Revelation 21:8).</p>\r\n<h2>The Solution</h2>\r\n<p>Without God\'s intervention, the situation regarding mankind\'s dilemma would be hopeless. &nbsp;But, God who is rich in mercy and love ordained from eternity past that He Himself would provide the solution by sending His own Son. &nbsp;\"But God demonstrates His own love toward us, in that while we were yet sinners, Christ died for us\" (Romans 5:8). &nbsp;Jesus Christ, God the Son, took upon Himself the wrath of God that we rightfully deserved to endure. &nbsp;Isaiah says: \"But He was pierced through for our transgressions, He was crushed for our iniquities; The chastening for our well-being fell upon Him, And by His scourging we are healed. &nbsp;All of us like sheep have gone astray, Each of us has turned to his own way; But the LORD has caused the iniquity of us all To fall on Him\" (Isaiah 53:5-6). &nbsp;</p>\r\n<h2><span style=\"color: #007db0; line-height: normal; font-size: 18px; \">The Way</span></h2>\r\n<p><span style=\"color: #007db0; line-height: normal; font-size: 18px; \"><span style=\"color: #535558; font-size: 13px; line-height: 19px; \">The Bible declares that the benefits of Jesus Christ\'s death are can only be received by faith. &nbsp;We are called to place all of our faith in Jesus. &nbsp;\"Whoever believes in Him shall not perish, but have eternal life\" (John 3:16). &nbsp;To believe in Jesus is not only to believe the truth about Him but to entrust all of yourself to Him, depending upon Him entirely, not only for your salvation but your existence. &nbsp;To believe in Jesus means you turn away from your sin to follow Him in faith and obedience. &nbsp;</span></span></p>\r\n<p>If you would like more information about Jesus and salvation -----.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div><span style=\"color: #007db0; line-height: normal; font-size: 18px; \"><span style=\"color: #535558; font-size: 13px; line-height: 19px; \"><br /></span></span></div>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('105', '<h3>\"Believe in the Lord Jesus and you will be saved\" (Acts 16:31). &nbsp;</h3>\r\n<h2>The Problem</h2>\r\n<p>The Bible declares that we need to be saved. &nbsp;This implies that we have a problem we need to be rescued from. &nbsp;Scripture is clear that our problem is sin and the consequences of sin - death. &nbsp;Romans 3:23 says: \"all have sinned and fall short of the glory of God.\" &nbsp;Genesis says, \"the LORD saw that the wickedness of man was great on the earth, and that every intent of the thoughts of his heart was only evil continually\" (Genesis 6:5). &nbsp;The Bible is equally clear that the just penalty for our sin against God is death, both physical and eternal. &nbsp;\"For the wages of sin is death\" (Romans 6:23). &nbsp;\"But for the cowardly and unbelieving and abominable and murderers and immoral persons and sorcerers and idolaters and all liars, their part will be in the lake that burns with fire and brimstone, which is the second death\" (Revelation 21:8).</p>\r\n<h2>The Solution</h2>\r\n<p>Without God\'s intervention, the situation regarding mankind\'s dilemma would be hopeless. &nbsp;But, God who is rich in mercy and love ordained from eternity past that He Himself would provide the solution by sending His own Son. &nbsp;\"But God demonstrates His own love toward us, in that while we were yet sinners, Christ died for us\" (Romans 5:8). &nbsp;Jesus Christ, God the Son, took upon Himself the wrath of God that we rightfully deserved to endure. &nbsp;Isaiah says: \"But He was pierced through for our transgressions, He was crushed for our iniquities; The chastening for our well-being fell upon Him, And by His scourging we are healed. &nbsp;All of us like sheep have gone astray, Each of us has turned to his own way; But the LORD has caused the iniquity of us all To fall on Him\" (Isaiah 53:5-6). &nbsp;</p>\r\n<h2><span style=\"color: #007db0; line-height: normal; font-size: 18px; \">The Way</span></h2>\r\n<p><span style=\"color: #007db0; line-height: normal; font-size: 18px; \"><span style=\"color: #535558; font-size: 13px; line-height: 19px; \">The Bible declares that the benefits of Jesus Christ\'s death are can only be received by faith. &nbsp;We are called to place all of our faith in Jesus. &nbsp;\"Whoever believes in Him shall not perish, but have eternal life\" (John 3:16). &nbsp;To believe in Jesus is not only to believe the truth about Him but to entrust all of yourself to Him, depending upon Him entirely, not only for your salvation but your existence. &nbsp;To believe in Jesus means you turn away from your sin to follow Him in faith and obedience. &nbsp;</span></span></p>\r\n<p>If you would like more information about Jesus and salvation -----.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div><span style=\"color: #007db0; line-height: normal; font-size: 18px; \"><span style=\"color: #535558; font-size: 13px; line-height: 19px; \"><br /></span></span></div>');
