INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('110', '<p>&nbsp;</p>\r\n<h3>\"Go therefore and make disciples of all the nations, baptizing them in the name of the Father and the Son and the Holy Spirit\" (Matthew 28:19).</h3>\r\n<p>&nbsp;</p>\r\n<p>Baptism is Jesus\' desire for everyone who becomes His disciple. &nbsp;It serves as an outward demonstration of the realities experienced by all who have truly been born again. &nbsp;Romans declares that all who have experienced salvation have \"have been buried with Him through baptism into death, so that as Christ was raised from the dead through the glory of the Father, so we too might walk in newness of life\" (Romans 6:4). &nbsp;Thus being baptized into water pictures our death to our former way of life and the beginning of a transformed life. &nbsp;</p>\r\n<p>Baptism also serves to identify us as one with the Triune God. &nbsp;Through baptism we not only publicly portray the gospel but our own&nbsp;allegiance&nbsp;to Jesus Christ, God the Son, and the fact that we are His follower. &nbsp;Galatians 3:27 says: \"For all of you who were baptized into Christ have clothed yourselves with Christ.\"</p>\r\n<p>Baptism is thus an opportunity to publicly proclaim the gospel and our union with Jesus Christ. &nbsp;The Bible is clear that baptism is only a symbol and in now way saves us. &nbsp;Salvation is only received by faith in Jesus Christ. &nbsp;</p>\r\n<h3>If you would like more information regarding baptism or would like to be baptized please fill out the form below.</h3>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('112', '<p><span style=\"color: #007db0; line-height: normal; font-size: 14px;\">\"Go therefore and make disciples of all the nations,baptizing them in the name of the Father and the Son and the Holy Spirit\" (Matthew 28:19).</span></p>\r\n<p>Baptism is Jesus\' desire for everyone who becomes His disciple. &nbsp;It serves as an outward demonstration of the realities experienced by all who have truly been born again. &nbsp;Romans declares that all who have experienced salvation have \"have been buried with Him through baptism into death, so that as Christ was raised from the dead through the glory of the Father, so we too might walk in newness of life\" (Romans 6:4). &nbsp;Thus being baptized into water pictures our death to our former way of life and the beginning of a transformed life. &nbsp;</p>\r\n<p>Baptism also serves to identify us as one with the Triune God. &nbsp;Through baptism we not only publicly portray the gospel but our own&nbsp;allegiance&nbsp;to Jesus Christ, God the Son, and the fact that we are His follower. &nbsp;Galatians 3:27 says: \"For all of you who were baptized into Christ have clothed yourselves with Christ.\"</p>\r\n<p>Baptism is thus an opportunity to publicly proclaim the gospel and our union with Jesus Christ. &nbsp;The Bible is clear that baptism is only a symbol and in now way saves us. &nbsp;Salvation is only received by faith in Jesus Christ. &nbsp;</p>\r\n<h3>If you would like more information regarding baptism or would like to be baptized please fill out the form below.</h3>');
