INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('114', '<p><span style=\"color: #007db0; line-height: normal; font-size: 14px;\">\"Go therefore and make disciples of all the nations, baptizing them in the name of the Father and the Son and the Holy Spirit\" (Matthew 28:19).</span></p>\r\n<p>Baptism is Jesus\' desire for everyone who becomes His disciple. &nbsp;It serves as an outward demonstration of the realities experienced by all who have truly been born again. &nbsp;Scripture declares that all who have experienced salvation \"have been buried with Him through baptism into death, so that as Christ was raised from the dead through the glory of the Father, so we too might walk in newness of life\" (Romans 6:4). &nbsp;Thus being baptized into water pictures our death to our former way of life and the beginning of a transformed life. &nbsp;</p>\r\n<p>Baptism also serves to identify us as one with the Triune God. &nbsp;Through baptism we not only publicly portray the gospel but our own&nbsp;allegiance&nbsp;to Jesus Christ, God the Son, and the fact that we are His follower. &nbsp;Galatians 3:27 says: \"For all of you who were baptized into Christ have clothed yourselves with Christ.\"</p>\r\n<p>Baptism is thus an opportunity to publicly proclaim the gospel and our union with Jesus Christ. &nbsp;The Bible is clear that baptism is only a symbol and in now way saves us. &nbsp;Salvation is only received by faith in Jesus Christ. &nbsp;</p>\r\n<p>At Cornerstone, we practice believer\'s baptism, meaning we baptize only those who have professed faith in Jesus Christ. &nbsp;We also practice baptism by immersion, meaning we baptize believers in water by submerging them. &nbsp;</p>\r\n<h3>If you would like more information regarding baptism or would like to be baptized please fill out the form below.</h3>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('115', '<p><span style=\"color: #007db0; line-height: normal; font-size: 14px;\">\"Go therefore and make disciples of all the nations, baptizing them in the name of the Father and the Son and the Holy Spirit\" (Matthew 28:19).</span></p>\r\n<p>Baptism is Jesus\' desire for everyone who becomes His disciple. &nbsp;It serves as an outward demonstration of the realities experienced by all who have truly been born again. &nbsp;Scripture declares that all who have experienced salvation \"have been buried with Him through baptism into death, so that as Christ was raised from the dead through the glory of the Father, so we too might walk in newness of life\" (Romans 6:4). &nbsp;Thus being baptized into water pictures our death to our former way of life and the beginning of a transformed life. &nbsp;</p>\r\n<p>Baptism also serves to identify us as one with the Triune God. &nbsp;Through baptism we not only publicly portray the gospel but our own&nbsp;allegiance&nbsp;to Jesus Christ, God the Son, and the fact that we are His follower. &nbsp;Galatians 3:27 says: \"For all of you who were baptized into Christ have clothed yourselves with Christ.\"</p>\r\n<p>Baptism is thus an opportunity to publicly proclaim the gospel and our union with Jesus Christ. &nbsp;The Bible is clear that baptism is only a symbol and in now way saves us. &nbsp;Salvation is only received by faith in Jesus Christ. &nbsp;</p>\r\n<p>At Cornerstone, we practice believer\'s baptism, meaning we baptize only those who have professed faith in Jesus Christ. &nbsp;We also practice baptism by immersion, meaning we baptize believers in water by submerging them. &nbsp;</p>\r\n<h3>If you would like more information regarding baptism or would like to be baptized please fill out the form below.</h3>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('116', '<p>Membership =&nbsp;Commitment. &nbsp;Becoming a member of Cornerstone simply means you are committing yourself to us and we are committing ourselves to you. &nbsp;Through membership, you are blessed as you place yourself under the care, instruction, and accountability of the elders and Cornerstone family. &nbsp;Through membership, Cornerstone is blessed with your presence, gifts, and influence as you invest in the lives of those around you. &nbsp;God intended for believers to become part of his body which is the church and to experience the richness of community that is found in committed relationships within local churches. &nbsp;Membership is the way for you as well as us to facilitate that community and commitment&nbsp;among&nbsp;one another. &nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Though the Bible does not mention the word \"member\" or \"membership\" <strong>it does teach the idea of membership</strong>. &nbsp;</p>\r\n<ul>\r\n</ul>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('117', '<p style=\"text-align: justify;\"><strong>Membership =&nbsp;Commitment</strong>. &nbsp;Becoming a member of Cornerstone simply means you are committing yourself to us and we are committing ourselves to you. &nbsp;Through membership, you are blessed as you place yourself under the care, instruction, and accountability of the elders and members of Cornerstone. &nbsp;Through membership, Cornerstone is blessed with your presence, gifts, and influence as you invest in the lives of those around you. &nbsp;</p>\r\n<p style=\"text-align: justify;\">God intended for believers to become part of his body which is the church and to experience the richness of community that is found in committed relationships within local churches. Membership is the way for you as well as us to facilitate that community and commitment&nbsp;among&nbsp;one another. &nbsp;</p>\r\n<p style=\"text-align: justify;\">Though the Bible does not mention the word \"member\" or \"membership\" <strong>it does teach the idea of membership</strong>. &nbsp;The church of the New Testament would not have understood the concept of a Christian who was not associated with and committed to a local body of believers. &nbsp;Indeed, the language used to describe the church (body, flock, temple, household) evokes the idea of those who are a committed and vital part of that community. &nbsp;God\'s call on church leaders to care for His people&nbsp;necessitates&nbsp;that pastors/elders know who they are being called to shepherd, instruct, disciple, and guard (1 Peter 5:1-3; Acts 20:28; Matthew 18:15-17; 1 Corinthians 5). Likewise, God\'s call on members of the local church to follow and obey their leaders assumes that they have joined themselves to a local body of believers (Hebrews 13:17).</p>\r\n<p style=\"text-align: justify;\">Our desire is that everyone at Cornerstone would become a vital and committed member of the church. &nbsp;If you would like more information on membership, we would like to invite you to our next membership class. &nbsp;</p>\r\n<p style=\"text-align: justify;\">Our next Membership Class is&nbsp;</p>\r\n<ul>\r\n</ul>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('118', '<p style=\"text-align: justify;\"><strong>Membership =&nbsp;Commitment</strong>. &nbsp;Becoming a member of Cornerstone simply means you are committing yourself to us and we are committing ourselves to you. &nbsp;Through membership, you are blessed as you place yourself under the care, instruction, and accountability of the elders and members of Cornerstone. &nbsp;Through membership, Cornerstone is blessed with your presence, gifts, and influence as you invest in the lives of those around you. &nbsp;</p>\r\n<p style=\"text-align: justify;\">God intended for believers to become part of his body which is the church and to experience the richness of community that is found in committed relationships within local churches. Membership is the way for you as well as us to facilitate that community and commitment&nbsp;among&nbsp;one another. &nbsp;</p>\r\n<p style=\"text-align: justify;\">Though the Bible does not mention the word \"member\" or \"membership\" <strong>it does teach the idea of membership</strong>. &nbsp;The church of the New Testament would not have understood the concept of a Christian who was not associated with and committed to a local body of believers. &nbsp;Indeed, the language used to describe the church (body, flock, temple, household) evokes the idea of those who are a committed and vital part of that community. &nbsp;God\'s call on church leaders to care for His people&nbsp;necessitates&nbsp;that pastors/elders know who they are being called to shepherd, instruct, disciple, and guard (1 Peter 5:1-3; Acts 20:28; Matthew 18:15-17; 1 Corinthians 5). Likewise, God\'s call on members of the local church to follow and obey their leaders assumes that they have joined themselves to a local body of believers (Hebrews 13:17).</p>\r\n<p style=\"text-align: justify;\">Our desire is that everyone at Cornerstone would become a vital and committed member of the church. &nbsp;If you would like more information on membership, we would like to invite you to our next membership class. &nbsp;</p>\r\n<h3>Our next Membership Class is:</h3>\r\n<h1>May 16, 2010 - 12:30 - 3:30 p.m.</h1>\r\n<h3>Register for the Membership Class to let us know your coming:</h3>\r\n<ul>\r\n</ul>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('121', '<p>We want to invite you to join us for our next visitor\'s reception. &nbsp;This is a time for recent visitors to connect with some of the pastoral staff and learn more about Cornerstone. &nbsp;We usually meet right after our second service for a time of meet and greet, Q &amp; A, and refreshments.</p>\r\n<h3>Our next Visitor\'s Reception is:</h3>\r\n<h1>April 25, 2010 from&nbsp;12:15-1:15 p.m.</h1>\r\n<h3>Register for the Reception to let us know you\'re coming:</h3>');
