INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('124', '<p>Care Groups are a vital part of Cornerstone. &nbsp;Through Care Groups we are able to practice the four values of Acts 2:42 - The Apostles\' Teaching, Fellowship, The Breaking of the Bread, and Prayer. &nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('125', '<h3>\"They were continually devoting themselves to the apostles\' teaching and to fellowship, to the breaking of bread and to prayer\" (Acts 2:42).</h3>\r\n<p>&nbsp;</p>\r\n<p>Cornerstone seeks to practice the values of the early church. &nbsp;In our times of corporate gather, whether on Sunday morning or in our Care Groups, we desire to focus on the four values of Acts 2:42. &nbsp;</p>\r\n<h2>The Apostles\' Teaching</h2>\r\n<p>d</p>\r\n<h2>Fellowship</h2>\r\n<p>d</p>\r\n<h2>The Breaking of the Bread</h2>\r\n<p>d</p>\r\n<h2>Prayer</h2>\r\n<p>d</p>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('126', '<h3>\"They were continually devoting themselves to the apostles\' teaching and to fellowship, to the breaking of bread and to prayer\" (Acts 2:42).</h3>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #535558; font-size: 13px; line-height: 19px;\">Cornerstone seeks to practice the values of the early church. &nbsp;In our times of corporate gather, whether on Sunday morning or in our Care Groups, we desire to focus on the four values of Acts 2:42. &nbsp;</span></p>\r\n<h2>The Apostles\' Teaching</h2>\r\n<p>The Apostles\' Teaching was the inspired Word of God that was being taught to the early church. &nbsp;It included both the Old Testament which the Apostles affirmed, explained, and applied as well as the New Testament revelation that they were directly receiving. &nbsp;Today at Cornerstone, we seek to study, understand, and apply the Word of God in our Sunday service, Care Groups, and our homes. &nbsp;</p>\r\n<h2>Fellowship</h2>\r\n<p>The word \"fellowship\" denotes close relationships. &nbsp;Fellowship was not simply believers \"hanging out.\" &nbsp;It came to mean any kind of&nbsp;ministry&nbsp;where we exchange, celebrate, and nurture what we already have in common in Jesus Christ. &nbsp;Today at Cornerstone, we desire to create opportunities for true fellowship among believers where God is glorified, relationships are strengthened, and individuals are edified and encouraged in the truth of the gospel.</p>\r\n<h2>The Breaking of Bread</h2>\r\n<p>In the original language the phrase is actually \"the breaking of THE bread\" and signified the celebration of the Lord\'s supper or communion. &nbsp;The early church remained committed to obediently observe and celebrate the Lord\'s death through the ordinance of communion. &nbsp;Today at Cornerstone, we seek to keep the Lord\'s death before us by remembering His death on the cross and celebrating the power and hope of the gospel through communion. &nbsp;Whether once a month in our Sunday service or each week in our Care Groups, we come face to face with the power of the cross as we participate in the breaking of the bread.</p>\r\n<h2>Prayer</h2>\r\n<p>The early church was devoted to prayer and not simply as individuals but corporately as the church. &nbsp;They recognized the importance of time spent worshiping, praising, and petitioning God by coming into His presence as a body in prayer. &nbsp;Today at Cornerstone, we seek to keep prayer a vital part of our relationship with Jesus Christ. &nbsp;Thus, we devote a portion of our time each week in our Care Groups to the practice and privilege or corporate prayer. &nbsp;Additionally, we seek to reserve special Sundays for times of corporate praise, thanksgiving, and prayer.</p>\r\n<p>&nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('127', '<p>Care Groups are a vital part of Cornerstone. &nbsp;Each Care Group is a multi-generational gathering of 20-30 people who seek to glorify God by living out&nbsp;<a title=\"Our Mission\" href=\"{CCM:CID_65}\">Our Mission</a>&nbsp;as they pursue loving relationships and grow in community. &nbsp;Through Care Groups we are able to practice the four values of Acts 2:42 - The Apostles\' Teaching, Fellowship, The Breaking of the Bread, and Prayer. &nbsp;Learn more about the four values&nbsp;by visiting <a title=\"Our Values\" href=\"{CCM:CID_97}\">Our Values</a>&nbsp;page.</p>\r\n<p>We desire to see every member of Cornerstone actively involved in a Care Group. &nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('128', '<p>Care Groups are a vital part of Cornerstone. &nbsp;Each Care Group is a multi-generational gathering of 20-30 people who seek to glorify God by living out&nbsp;<a title=\"Our Mission\" href=\"{CCM:CID_65}\">Our Mission</a>&nbsp;as they pursue loving relationships and grow in community. &nbsp;</p>\r\n<p>Care Groups meet formally at least once a week for 2 to 3 hours. &nbsp;A typical Care Group meeting includes a time of Worship, Communion, Discussion, Prayer, and Fellowship. &nbsp;Through Care Groups we are able to practice the four values of Acts 2:42 - The Apostles\' Teaching, Fellowship, The Breaking of the Bread, and Prayer. &nbsp;Learn more about the four values&nbsp;by visiting&nbsp;<a title=\"Our Values\" href=\"{CCM:CID_97}\">Our Values</a>&nbsp;page. &nbsp;Members of each Care Group also stay connected throughout the week in various ways including vial phone/email, hospitality, prayer, service projects, and community events. &nbsp;</p>\r\n<p>We desire to see every member of Cornerstone actively involved in a Care Group. &nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('129', '<h2>Cornerstone Fellowship Bible Church</h2>\r\n<p>1363 W. Linden St.<br />Riverside, CA 91507<br />(951)-781-8174	Phone<br />(951)-781-3583	Fax<br /><strong>cfbc@cornerstonebible.org</strong></p>\r\n<p><!--EndFragment--></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('130', '<div style=\"float:right;\">\r\n<object width=\"400\" height=\"220\">\r\n<param name=\"allowfullscreen\" value=\"true\" />\r\n<param name=\"allowscriptaccess\" value=\"always\" />\r\n<param name=\"movie\" value=\"http://vimeo.com/moogaloop.swf?clip_id=5966916&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1\" /><embed type=\"application/x-shockwave-flash\" width=\"400\" height=\"220\" src=\"http://vimeo.com/moogaloop.swf?clip_id=5966916&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=00ADEF&amp;fullscreen=1\" allowscriptaccess=\"always\" allowfullscreen=\"true\"></embed>\r\n</object>\r\n</div>\r\n<p style=\"text-align: justify;\">Thank you for visiting Cornerstone\'s website. We look forward to getting to know you as you get to know us.</p>\r\n<p style=\"text-align: justify;\">You can find out more about Cornerstone, who we are, and what we are passionate about by browsing the links to the left, visiting our <a title=\"About\" href=\"{CCM:CID_49}\">About</a> page, and watching our Gospel Vision video here.</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('131', '<p style=\"text-align: justify;\">We encourage you to visit us for either of our Sunday Celebration Services. &nbsp;Our first service is from 8:30-10:00 a.m. and our second service is from 10:30-12:00 p.m. For directions see our <a title=\"Location &amp; Services\" href=\"{CCM:CID_61}\">Location &amp; Services</a>. &nbsp;</p>\r\n<h2 style=\"text-align: justify;\"><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Parking</span></span></h2>\r\n<p style=\"text-align: justify;\">Upon your arrival, you are welcome to park in either our lower or upper parking lots. &nbsp;</p>\r\n<h2 style=\"text-align: justify;\"><span style=\"font-size: x-large;\"><span style=\"font-size: medium;\">Children</span></span></h2>\r\n<p style=\"text-align: justify;\">Children are welcome to participate in our entire service. &nbsp;Those who stay during our preaching time will receive \"kid\'s sermon notes\" and are encouraged to follow along as we study the Word. &nbsp;We also provide a full-range of Children\'s Ministry options including:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Nursery &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (0-2 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</li>\r\n<li>Toddler Care &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2-3 years) &nbsp; &nbsp; &nbsp; &nbsp; Both Services</li>\r\n<li>Children\'s Church &nbsp; &nbsp; (4-9 years) &nbsp; &nbsp; &nbsp; &nbsp; 9:00-10:00 a.m.</li>\r\n<li>Worship Time &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 10:30-11:00 a.m.</li>\r\n<li>Sunday School &nbsp; &nbsp; &nbsp; &nbsp;(4-18 years) &nbsp; &nbsp; &nbsp; 11:00-1200 p.m.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">To learn more about Children\'s Ministry check out our <span style=\"font-size: x-small;\"><span style=\"font-size: small;\"><a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<h2 style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-size: medium;\">Adult</span></span></h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-size: small;\">Adults are encouraged to join us for our equipping school. &nbsp;We have classes offered during both services. &nbsp;To find out more about current classes being offered check out our&nbsp;<a title=\"Ministries\" href=\"{CCM:CID_51}\">Ministries</a>&nbsp;page.</span></span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-size: small;\"><br /></span></span></p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('132', '<p style=\"text-align: justify;\">We want to invite you to join us for our next visitor\'s reception. &nbsp;This is a time for recent visitors to connect with some of the pastoral staff and learn more about Cornerstone. &nbsp;We usually meet right after our second service for a time of meet and greet, Q &amp; A, and refreshments.</p>\r\n<h3 style=\"text-align: justify;\">Our next Visitor\'s Reception is:</h3>\r\n<h1 style=\"text-align: justify;\">April 25, 2010 from&nbsp;12:15-1:15 p.m.</h1>\r\n<h3 style=\"text-align: justify;\">Register for the Reception to let us know you\'re coming:</h3>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('147', '<p style=\"text-align: justify;\">The Gospel literally means &ldquo;good news.&rdquo;&nbsp; In the Bible, the gospel is the good news regarding what God accomplished in the person and work of Jesus Christ - namely our salvation. &nbsp;The entire Bible tells the story of the lengths that God went to in order to bring glory to Himself and save sinners. &nbsp;Scripture prepares us for the gospel, recalls the events of the gospel, and celebrates the triumphs of the gospel throughout its pages. &nbsp;</p>\r\n<p style=\"text-align: justify;\">The gospel proclaims the beautiful truth that \"</p>\r\n<p style=\"text-align: justify;\">Cornerstone is all about the gospel.  Not only for salvation but for living every single moment.</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('153', '<p style=\"text-align: justify;\">Care Groups are a vital part of Cornerstone. &nbsp;Each Care Group is a multi-generational gathering of 20-30 people who seek to glorify God by living out&nbsp;<a title=\"Our Mission\" href=\"{CCM:CID_65}\">Our Mission</a>&nbsp;as they pursue loving relationships and grow in community. &nbsp;</p>\r\n<p style=\"text-align: justify;\">Care Groups meet formally at least once a week for 2 to 3 hours. &nbsp;A typical Care Group meeting includes a time of Worship, Communion, Discussion, Prayer, and Fellowship. &nbsp;Through Care Groups we are able to practice the four values of Acts 2:42 - The Apostles\' Teaching, Fellowship, The Breaking of the Bread, and Prayer. &nbsp;Learn more about the four values&nbsp;by visiting&nbsp;<a title=\"Our Values\" href=\"{CCM:CID_97}\">Our Values</a>&nbsp;page. &nbsp;Members of each Care Group also stay connected throughout the week in various ways including vial phone/email, hospitality, prayer, service projects, and community events. &nbsp;</p>\r\n<p style=\"text-align: justify;\">We desire to see every member of Cornerstone actively involved in a Care Group. &nbsp;To learn more about Care Groups you can get in touch with our Care Group Pastor, Karlos Limtiaco and schedule a time to visit a few Care Groups. &nbsp;To see a list of current Care Groups check out our&nbsp;<a title=\"Care Groups - Current Groups\" href=\"{CCM:CID_96}\">Care Groups - Current Groups</a>&nbsp;page. &nbsp;</p>');
INSERT INTO `btContentLocal` (`bID`, `content`) VALUES ('156', '<p style=\"text-align: justify;\">We want every member of Cornerstone to be thoroughly equipped for every good work and every area of life. &nbsp;Our Equipping School exists to build you up in the Word of God and strengthen you to live out the glory of the gospel in all that God calls you to. &nbsp;</p>\r\n<p style=\"text-align: justify;\">For those who are new to Cornerstone, we encourage you to attend our Core Classes. &nbsp;The Core Classes include _, _, _, which cover ....</p>\r\n<p style=\"text-align: justify;\">Once you\'ve graduated from our Core Classes, Cornerstone invites you to be a part of our Growth Classes. &nbsp;Growth Classes are designed to build upon the foundational truths covered in the Core Classes and offer Cornerstone members continued opportunities to grow in their understanding of God\'s Word and its application to various areas of life. &nbsp;For a current list of Growth Classes, check out our &nbsp;page. &nbsp;</p>');
